import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import landingImage from "../assets/landing1.webp"


export default function LandinPage(){
    return(
        <Container style={{ backgroundImage: landingImage, backgroundSize: "contain", backgroundRepeat: "no-repeat" }}>
            <Image src={landingImage} alt="" />
            <Title>Bienvenidos a Mattger GAMES</Title>
            <Link to = '/home'>
                <button>Ingresar</button>
            </Link>
        </Container>
    )
}

const Container = styled.div `
height: 100vh;
width: 100vw;
display: flex;
flex-direction: column;
align-content: center;
justify-content: center;
align-items: center;
`
const Image = styled.img `
z-index: 0;
height: 100vh;
width: 100vw;
position: absolute;
top: 0;
left: 0;
`
const Title = styled.h1 `
z-index: 1;
color: white;
`
const Button = style.button `

`
